import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-user-settings',
  templateUrl: './user-settings.component.html',
  styleUrls: ['./user-settings.component.css']
})
export class UserSettingsComponent implements OnInit {

  constructor() { }

  ngOnInit(): void {
    // Initialization logic goes here
  }
}
<!-- user-settings.component.html -->
<ul class="nav nav-pills flex-column">
  <li class="nav-item">
    <a class="nav-link text-dark" id="profile" [routerLink]="['/user-settings/profile']"><i class="far fa-user"></i> Profile</a>
  </li>
  <li class="nav-item">
    <a class="nav-link text-dark" id="email" [routerLink]="['/user-settings/email']"><i class="fas fa-at"></i> Email</a>
  </li>
  <li class="nav-item">
    <a class="nav-link text-dark" id="change-password" [routerLink]="['/user-settings/change-password']"><i class="fas fa-key"></i> Password</a>
  </li>
</ul>
